import { useNavigate, NavLink } from "react-router-dom";
import styles from "./styles.module.css";
import Footer from "../footer/index";
import Cal from "../Calendar/cal";
import Pie from "../piechart/Pie";
import Line from "../Linegraph/Line";
import Navigation from "../NavBar/index";

const Main = ({ totalIncome }) => {  // Accept totalIncome as a prop
    const navigate = useNavigate();

    const handleLogout = () => {
        navigate("/");
    };

    return (
        <div>
            <Navigation />
            <div className={styles.main_container}>
                <div className={styles.con}>
                    <div className={styles.money}>
                        <div className={styles.Total}>
                            <h2>Total Income:<sect className={styles.num}>${totalIncome.toFixed(2)}</sect></h2>  {/* Display the total income */}
                            <h2>Total Expense:<sect className={styles.num2}>50000</sect></h2>
                        </div>
                        <br />
                        <div className={styles.remain}>
                            <h2 >Remaining:<sect className={styles.num3}>50000</sect></h2>
                        </div>
                    </div>
                    <br />
                    <div className={styles.piechart}><Pie /></div>
                    <br />
                    <div className={styles.cal}><Cal /></div>
                </div>
                <div className={styles.line}><Line /></div>
                <div className={styles.foot}><Footer /></div>
            </div>
        </div>
    );
};

export default Main;
